import { FunctionComponent, useState } from 'react';
import { Button } from 'semantic-ui-react';
import { ETipoMensagem } from '../Enuns/ETipoMensagem';
import { Master } from './Master';
import Mensagem from './Mensagem/Mensagem';


let msg: JSX.Element;
export const Home: FunctionComponent = () => {
  const [isMessage, setMessage] = useState(false)
  
  function BtnAlerta ()
  { 
    return msg = <Mensagem Mensagem={"Mensagem de Aviso"} TipoMensagem={ETipoMensagem.Aviso}/>
    setMessage(true)
  }
  function BtnErro ()
  {
    return msg = <Mensagem Mensagem={"Mensagem de Erro"} TipoMensagem={ETipoMensagem.Erro}/>
    setMessage(true)
  }
  function BtnDone ()
  {
    return msg = <Mensagem Mensagem={"Mensagem de Certo"} TipoMensagem={ETipoMensagem.Done}/>
    setMessage(true)
  }
  function BtnConfirm()
  {
    return msg = <Mensagem Mensagem={"Mensagem de Confirmação"} TipoMensagem={ETipoMensagem.Confirmacao}/>
    setMessage(true)
  }
  return (
    <>
      <Master>    
        <button onClick={BtnAlerta}>Alerta</button>
        <button onClick={BtnErro}>Erro</button>
        <button onClick={BtnDone}>Done</button>
        <button onClick={BtnConfirm}>Confirmação</button> 
      </Master>
      {msg}
    </>
  );
};
